export class Visitor {
    // Person Data
    fullName = '';
    email = '';
    phone = '';
    personalID = '';
    responsable = '';

    // Event Data
    eventID = '';
    entryTime = '';
    exitTime = '';
    date = '';
    destination = '';

    constructor(fullName, email, phone, personalID, responsable, eventID, entryTime, exitTime, date, destination) {
        this.fullName = fullName;
        this.email = email;
        this.phone = phone;
        this.personalID = personalID;
        this.responsable = responsable;
        this.eventID = eventID;
        this.entryTime = entryTime;
        this.exitTime = exitTime;
        this.date = date;
        this.destination = destination;
    }
}
